    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "\u4f7f\u7528\u6ce8\u518c\u8ddf\u8e2a\u4f5c\u4e3a\u5212\u5206\u8ba8\u8bba\u7684\u57fa\u7840\u3002\u6240\u6709\u7684\u5b66\u5458\uff0c\u4e0d\u7ba1\u4ed6\u4eec\u7684\u6ce8\u518c\u8f68\u8ff9\u662f\u4ec0\u4e48\uff0c\u90fd\u53ef\u4ee5\u770b\u5230\u76f8\u540c\u7684\u8ba8\u8bba\u4e3b\u9898\uff0c\u4f46\u662f\u5728\u4e0d\u540c\u7684\u4e3b\u9898\u4e2d\uff0c\u53ea\u6709\u5728\u540c\u4e00\u6ce8\u518c\u8f68\u8ff9\u4e0a\u7684\u5b66\u4e60\u8005\u624d\u80fd\u770b\u5230\u5e76\u56de\u590d\u5f7c\u6b64\u7684\u5e16\u5b50\u3002", 
