    "You have selected an action, and you haven't made any changes on individual fields. You're probably looking for the Go button rather than the Save button.": "Voc\u00ea selecionou uma a\u00e7\u00e3o, e voc\u00ea n\u00e3o fez altera\u00e7\u00f5es em campos individuais. Voc\u00ea provavelmente est\u00e1 procurando o bot\u00e3o Ir ao inv\u00e9s do bot\u00e3o Salvar.", 
    "You have selected an action, but you haven't saved your changes to individual fields yet. Please click OK to save. You'll need to re-run the action.": "Voc\u00ea selecionou uma a\u00e7\u00e3o, mas voc\u00ea n\u00e3o salvou as altera\u00e7\u00f5es de cada campo ainda. Clique em OK para salvar. Voc\u00ea vai precisar executar novamente a a\u00e7\u00e3o.", 
    "You have selected \u201cDelete my account.\u201d Deletion of your account and personal data is permanent and cannot be undone. EdX will not be able to recover your account or the data that is deleted.": "\u60a8\u9009\u62e9\u4e86\u201c\u5220\u9664\u6211\u7684\u8d26\u53f7\u201d\uff0c\u5220\u9664\u8d26\u53f7\u4e0e\u4e2a\u4eba\u6570\u636e\u5c06\u65e0\u6cd5\u64a4\u9500\u3002EdX\u65e0\u6cd5\u6062\u590d\u60a8\u5df2\u5220\u9664\u7684\u8d26\u53f7\u6216\u6570\u636e\u3002", 
    "You have successfully signed into %(currentProvider)s, but your %(currentProvider)s account does not have a linked %(platformName)s account. To link your accounts, sign in now using your %(platformName)s password.": "\u60a8\u5df2\u6210\u529f\u767b\u5f55 %(currentProvider)s\uff0c\u4f46\u662f\u60a8\u7684 %(currentProvider)s \u5e10\u6237\u5c1a\u65e0\u5df2\u94fe\u63a5\u7684 %(platformName)s \u5e10\u6237\u3002\u8981\u94fe\u63a5\u5230\u60a8\u7684\u8d26\u6237\uff0c\u8bf7\u4f7f\u7528\u60a8\u7684 %(platformName)s \u5bc6\u7801\u767b\u5f55\u3002", 
    "You have successfully updated your goal.": "\u60a8\u5df2\u6210\u529f\u66f4\u65b0\u76ee\u6807\u3002", 
