    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "\u60a8\u53ef\u80fd\u8fd8\u4f1a\u65e0\u6cd5\u8bbf\u95ee\u5df2\u8ba4\u8bc1\u8bc1\u4e66\u548c\u5176\u4ed6\u5b66\u4e60\u65b9\u6848\u7684\u8bc1\u4e66\uff0c\u6bd4\u5982MicroMasters\u8bc1\u4e66\u3002\u5982\u679c\u60a8\u5e0c\u671b\u5728\u5220\u9664\u524d\u5bf9\u8fd9\u4e9b\u6587\u4ef6\u8fdb\u884c\u62f7\u8d1d\uff0c\u8bf7\u6839\u636e\u6307\u5f15{htmlStart}\u6253\u5370\u6216\u4e0b\u8f7d\u8bc1\u4e66{htmlEnd}\u3002", 
    "You must be over 13 to share a full profile. If you are over 13, make sure that you have specified a birth year on the {account_settings_page_link}": "13\u5c81\u4ee5\u4e0a\u7684\u7528\u6237\u624d\u80fd\u5206\u4eab\u5b8c\u6574\u8d44\u6599\u3002\u5982\u679c\u60a8\u572813\u5c81\u4ee5\u4e0a\uff0c\u8bf7\u786e\u8ba4\u5df2\u5728 {account_settings_page_link} \u9875\u9762\u4e2d\u586b\u5199\u4e86\u51fa\u751f\u5e74\u4efd\u3002", 
